// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8;

import "./interfaces/BentoBox.sol";
import "./interfaces/IERC20.sol";
import "./interfaces/SushiSwap.sol";



contract PhantasmManager {
    address private SUSHI_ROUTER;
    address private WETH;
    address private BENTOBOXV1;
    
    constructor(address _sushi_router, address _weth, address _bentoboxv1) {
        // Makes code more clean and organized for multi-chain deployments
        SUSHI_ROUTER = _sushi_router;
        WETH = _weth;
        BENTOBOXV1 = _bentoboxv1;
        // Approve Kashi Master Contract on Bentobox, so this contract
        // can interact with lending pools
        BentoBox(BENTOBOXV1).setMasterContractApproval(
            address(this),
            0x2cBA6Ab6574646Badc84F0544d05059e57a5dc42,
            true,
            0,
            0,
            0
        );
    }
    /*
        Sushi functions
            - Bridging onto and off of Bentobox
            - Converting BentoBox Shares to Actual token amounts and vice versa
            - Sushiswapping
            - Collateralizing and Borrowing on Kashi
    */
    function bridgeOn(address _asset, uint256 _amount) public {
        IERC20(_asset).transferFrom(msg.sender, address(this), _amount);
        IERC20(_asset).approve(BENTOBOXV1, _amount);
        //(address token_, address from, address to, uint256 amount, uint256 share)
        BentoBox(BENTOBOXV1).deposit(
            _asset,
            address(this),
            address(this),
            _amount,
            0
        );
    }

    function bridgeOff(
        address _asset,
        uint256 _amount,
        uint256 _shares
    ) public {
        BentoBox(BENTOBOXV1).withdraw(
            _asset,
            address(this),
            address(this),
            _amount,
            _shares
        );
    }
    function toAmount(address _asset, uint256 _share)
        public
        view
        returns (uint256)
    {
        // Don't round up, wouldn't want to overspend
        return BentoBox(BENTOBOXV1).toAmount(_asset, _share, false);
    }

    function toShare(address _asset, uint256 _amount)
        public
        view
        returns (uint256)
    {
        // Rounding can pose some interesting problems so avoiding it for now
